                        swal(""İlan başarıyla kayıt edildi."", {
                            icon: ""success"",
                        });
                        const myform = document.querySelector(""#myform"");
                        myform.submit();
                    } else {
                        swal(""Kaydedilmedi."");
                    }
                });
